import React, { useState } from 'react'

const Dropdown = () => {
    const [click, setclick] = useState(false);
    const clickHandler = () => setclick(!click);

    return (
        <ul onClick={clickHandler} className={click ? "dropdown clicked" : "dropdown"}>

        </ul>
    )
}

export default Dropdown
